      SELECT DISTINCT col2 * + col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT ( - col2 - - + 91 BETWEEN + 69 * col2 - - col0 - - col2 AND - col0 );
  - name: tab1

outputs:
  - name: q7196.out
    data: |
      1344
      295
      3196
